import { Breadcrumb, Row, Container } from "react-bootstrap";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

const parseText = (text) => {
  var displayedText = true;

  for (var x = 0; x < text.length; x++) {
    var c = text.charAt(x);

    if (displayedText && c == "-") {
      text = text.substring(0, x) + " " + text.substring(x, text.length);
    }
  }
  return text;
};

const FoldersHeaderBar = ({ crumbs }) => {
  return (
    <Container className="grey-box">
      <Row className="folders-navigation">
        <Breadcrumb>
          <Breadcrumb.Item href="/">
            <FontAwesomeIcon icon={"home"} />
          </Breadcrumb.Item>
          {crumbs.map((crumb) => (
            <Breadcrumb.Item href={`/${crumb}`}>
              {parseText(crumb)}
            </Breadcrumb.Item>
          ))}
        </Breadcrumb>
      </Row>
    </Container>
  );
};

export default FoldersHeaderBar;
